module.exports = "<div class=\"panel panel-default\" *ngIf=\"isHintVisible()\">\n  <div class=\"panel-heading\">\n    <h3>Категории трат</h3>\n  </div>\n  <div class=\"panel-body\">\n    <div class=\"m-b-md\">\n      <p>Задайте категории своих трат. Для примера я&nbsp;выбрала пятнадцать популярных. Удалите&nbsp;те, которые не&nbsp;подходят вам, и&nbsp;добавьте&nbsp;те, которые я&nbsp;упустила.</p>\n      <p>Обратите внимание, что каждой категории можно назначить цвет. Он&nbsp;будет использован при выводе графика трат категории. Если не&nbsp;указать цвет, её&nbsp;сектор будет выведен серым.</p>\n      <p>Когда закончите с&nbsp;категориями, я&nbsp;провожу вас по&nbsp;настройкам счетов.</p>\n    </div>\n\n    <div class=\"button-holder m-b-n-sm\">\n      <span><button class=\"btn m-b-sm btn-primary\" (click)=\"nextStep()\" [ladda]=\"loading\">Перейти к настройкам счетов</button></span>\n      <span class=\"m-l-xs\"><button class=\"btn m-b-sm btn-default \" (click)=\"close()\" [ladda]=\"loading\">Мне больше не нужны подсказки</button></span>\n    </div>\n  </div>\n</div>\n\n<div class=\"form\">\n  <div class=\"row\">\n    <div class=\"col-sm-6\">\n      <ul class=\"list-unstyled list-form\">\n        <li *ngFor=\"let category of categories\">\n          <input class=\"form-control\"\n                 type=\"text\"\n                 placeholder=\"Название\"\n                 [(ngModel)]=\"category.name\"\n                 (ngModelChange)=\"saveCategory(category)\">\n          <colorpicker [(ngModel)]=\"category.color\"\n                       [disabledOptions]=\"selectedColors\"\n                       (ngModelChange)=\"updateSelectedColors(); saveCategory(category)\">\n\n          </colorpicker>\n          <spinner [isLoaded]=\"isLoaded[category.id]\"></spinner>\n          <button class=\"btn-default btn-sm btn btn-inline\" (click)=\"deleteCategory(category)\"><i class=\"fa fa-lg fa-remove\"></i></button>\n        </li>\n\n        <li>\n          <input class=\"form-control\" type=\"text\" placeholder=\"Название\" [(ngModel)]=\"category.name\">\n          <colorpicker [(ngModel)]=\"category.color\"\n                       [disabledOptions]=\"selectedColors\"\n                       (ngModelChange)=\"updateSelectedColors()\">\n\n          </colorpicker>\n          <spinner [isLoaded]=\"isNewLoaded\"></spinner>\n          <button class=\"btn-primary btn-sm btn btn-inline\"\n                  (click)=\"addCategory()\"\n                  [disabled]=\"!category.name\"><i class=\"fa fa-lg fa-plus\"></i></button>\n        </li>\n      </ul>\n    </div>\n\n    <div class=\"col-sm-6\">\n      <div class=\"charts\" *ngIf=\"hasChart()\">\n        <h3>Распределение за {{startOfMonth | amDateFormat:'MMMM YYYY'}}</h3>\n        <div class=\"row\">\n          <div class=\"col-md-12\" *ngFor=\"let item of categoriesChart\">\n            <h4>{{item.currency}}</h4>\n            <canvas baseChart\n                    height=\"240\"\n                    class=\"chart\"\n                    chartType=\"pie\"\n                    [labels]=\"item.chartData.labels\"\n                    [data]=\"item.chartData.data\"\n                    [colors]=\"item.chartData.colors\"\n                    [options]=\"item.chartData.options\"\n                    [datasets]=\"item.chartData.datasets\"></canvas>\n          </div>\n        </div>\n      </div>\n    </div>\n  </div>\n</div>"

