module.exports = "<div class=\"panel panel-default\" *ngIf=\"isHintVisible()\">\n  <div class=\"panel-heading\">\n    <h3>Счета</h3>\n  </div>\n  <div class=\"panel-body\">\n    <div class=\"m-b-md\">\n      <p>Задайте счета или другие платёжные средства. Например: &laquo;наличные&raquo;, &laquo;карта сбербанка&raquo;, &laquo;отложено&raquo;, &laquo;абонемент в&nbsp;клуб&raquo;, &laquo;доллары&raquo;.</p>\n      <p>На&nbsp;странице истории полностью помещаются только короткие названия, лучше всего из&nbsp;одного слова.</p>\n      <p>В&nbsp;поле &laquo;вход&raquo; введите сумму на&nbsp;этом счету на&nbsp;сегодняшний день, например, &laquo;наличные долл.&raquo; и&nbsp;&laquo;500&raquo;, если у&nbsp;вас 500 долларов наличными.</p>\n      <p>Для счетов тоже можно назначать цвет. Он&nbsp;будет использован при выводе графика остатков.</p>\n      <p>Когда закончите со&nbsp;счетами, я&nbsp;провожу вас по&nbsp;настройкам источников доходов.</p>\n    </div>\n\n    <div class=\"button-holder m-b-n-sm\">\n      <span><button class=\"btn m-b-sm btn-primary\" (click)=\"nextStep()\" [disabled]=\"loading\">Перейти к настройкам доходов</button></span>\n      <span class=\"m-l-xs\"><button class=\"btn m-b-sm btn-default \" (click)=\"close()\" [disabled]=\"loading\">Мне больше не нужны подсказки</button></span>\n    </div>\n  </div>\n</div>\n\n<div class=\"form\">\n  <ul class=\"list-unstyled list-form\">\n    <li *ngFor=\"let paymentMethod of paymentMethods\">\n      <input class=\"form-control\"\n             type=\"text\"\n             placeholder=\"Название\"\n             (ngModelChange)=\"saveMethod(paymentMethod)\"\n             [(ngModel)]=\"paymentMethod.name\">,\n      <span class=\"text-nowrap\">\n        валюта:\n\n        <select class=\"form-control form-control--sm\"\n                [(ngModel)]=\"paymentMethod.currency\"\n                (ngModelChange)=\"saveMethod(paymentMethod)\">\n          <option *ngFor=\"let currency of currencies\"\n                  [ngValue]=\"currency\">{{ currency.code }}</option>\n        </select>\n      </span>,\n      <span class=\"text-nowrap\">\n        вход:\n        <input class=\"form-control form-control--sm\"\n               type=\"number\"\n               placeholder=\"0.00\"\n               placeholder=\"вход\"\n               (ngModelChange)=\"saveMethod(paymentMethod)\"\n               [(ngModel)]=\"paymentMethod.initialAmount\">\n      </span>\n\n      <colorpicker [(ngModel)]=\"paymentMethod.color\"\n                    [disabledOptions]=\"selectedColors\"\n                    (ngModelChange)=\"updateSelectedColors(); saveMethod(paymentMethod)\">\n\n      </colorpicker>\n      <spinner [isLoaded]=\"isLoaded[paymentMethod.id]\"></spinner>\n      <button class=\"btn-default btn-sm btn btn-inline\" (click)=\"deleteMethod(paymentMethod)\"><i class=\"fa fa-lg fa-remove\"></i></button>\n    </li>\n\n    <li>\n      <input class=\"form-control\" type=\"text\" placeholder=\"Название\" [(ngModel)]=\"paymentMethod.name\">,\n      <span class=\"text-nowrap\">\n        валюта: <select class=\"form-control form-control--sm\"\n                        [(ngModel)]=\"paymentMethod.currency\">\n        <option *ngFor=\"let currency of currencies\"\n                [ngValue]=\"currency\">{{ currency.code }}</option>\n      </select>\n\n      </span>,\n      <span class=\"text-nowrap\">\n        вход:\n        <input class=\"form-control form-control--sm\"\n               type=\"number\"\n               step=\"0.01\"\n               placeholder=\"вход\"\n               [(ngModel)]=\"paymentMethod.initialAmount\">\n      </span>\n      <colorpicker [(ngModel)]=\"paymentMethod.color\"\n                    [disabledOptions]=\"selectedColors\"\n                    (ngModelChange)=\"updateSelectedColors()\">\n\n      </colorpicker>\n      <spinner [isLoaded]=\"isNewLoaded\"></spinner>\n\n      <div class=\"button-hint\">\n        <div class=\"button-hint__inner\">\n          <button class=\"btn-primary btn-sm btn btn-inline\"\n                  [disabled]=\"!paymentMethod.name || !paymentMethod.currency\"\n                  (click)=\"addMethod()\">Добавить средство</button>\n          <div class=\"button-hint__text\" *ngIf=\"!paymentMethod.name || !paymentMethod.currency\">\n            Укажите\n            <span *ngIf=\"!paymentMethod.name\">название</span>\n            <span *ngIf=\"!paymentMethod.name && !paymentMethod.currency\">и</span>\n            <span *ngIf=\"!paymentMethod.currency\">валюту</span>\n          </div>\n        </div>\n      </div>\n    </li>\n  </ul>\n</div>"

