module.exports = "<div class=\"panel panel-default\" *ngIf=\"isHintVisible()\">\n  <div class=\"panel-heading\">\n    <h3>Переводы</h3>\n  </div>\n  <div class=\"panel-body\">\n    <div class=\"m-b-md\">\n      <p>Этот раздел в&nbsp;целом похож на&nbsp;предыдущие два, но&nbsp;есть несколько тонкостей.</p>\n      <p>Здесь вы&nbsp;переводите деньги с&nbsp;одного счёта на&nbsp;другой. Например, если вы&nbsp;обналичиваете в&nbsp;банкомате, это будет перевод со&nbsp;счёта &laquo;карта сбербанка&raquo; на&nbsp;счёт &laquo;наличные&raquo;.</p>\n      <p>Если вы&nbsp;при переводе конвертируете валюту, нужно дополнительно указать курс. Обычно в&nbsp;таких случаях речь идёт о&nbsp;покупке или продаже иностранной валюты. Например, если курс доллара к&nbsp;евро составляет 1.15, а&nbsp;вы&nbsp;покупаете евро за&nbsp;доллары, то&nbsp;курс нужно указать как &laquo;1.15&nbsp;к 1&raquo; (иначе говоря, вы&nbsp;покупаете 100 евро за&nbsp;115&nbsp;долларов). Если&nbsp;же на&nbsp;доллары вы&nbsp;купили рубли, то&nbsp;курс будет, например, 1&nbsp;к 64.</p>\n      <p>Курс нужно вводить, когда валюта целевого счёта отличается от&nbsp;валюты платёжного средства.</p>\n      <p>Тут&nbsp;же переводите деньги на&nbsp;счета других пользователей Транжиры. Например, если вы&nbsp;дали супругу или супруге 500&nbsp;долларов, это можно оформить как перевод с&nbsp;вашего долларового счёта на&nbsp;его (её)&nbsp;счёт. Для этого ей&nbsp;нужно расшарить свой долларовый счёт вам в&nbsp;настройках счёта.</p>\n      <p>Поэкспериментируйте с&nbsp;переводами, после чего перейдём к&nbsp;последнему разделу&nbsp;&mdash; истории платежей.</p>\n    </div>\n\n    <div class=\"button-holder m-b-n-sm\">\n      <span><button class=\"btn m-b-sm btn-primary\" (click)=\"nextStep()\" [ladda]=\"loading\">Перейти к истории</button></span>\n      <span class=\"m-l-xs\"><button class=\"btn m-b-sm btn-default \" (click)=\"close()\" [ladda]=\"loading\">Мне больше не нужны подсказки</button></span>\n    </div>\n  </div>\n</div>\n\n<div class=\"form\" *ngIf=\"expense && income\">\n  <a class=\"back-link\" [hidden]=\"!editMode\" routerLink=\"/history\">&larr; Назад к истории</a>\n\n  <div>\n    Перевёл <input autofocus class=\"form-control form-control--sm\" type=\"number\" name=\"amount\" [(ngModel)]=\"expense.amount\" placeholder=\"0.00\">\n    {{expense.paymentMethod?.currency?.symbol}}\n    <select class=\"form-control form-control--lg\"\n            name=\"expensePaymentMethod\"\n            [(ngModel)]=\"expense.paymentMethod\">\n      <option *ngFor=\"let paymentMethod of paymentMethods\"\n              [ngValue]=\"paymentMethod\"\n              [disabled]=\"income.paymentMethod && income.paymentMethod.id === paymentMethod.id\">{{ paymentMethod.name }}</option>\n    </select>\n    <span class=\"text-nowrap\">\n      на <select class=\"form-control form-control--lg\"\n                 name=\"incomePaymentMethod\"\n                 [(ngModel)]=\"income.paymentMethod\">\n      <option *ngFor=\"let paymentMethod of paymentMethods\"\n              [ngValue]=\"paymentMethod\" \n              [disabled]=\"expense.paymentMethod && expense.paymentMethod.id === paymentMethod.id\">{{ paymentMethod.name }}</option>\n    </select>\n    </span>\n    <span *ngIf=\"expense.paymentMethod && income.paymentMethod && expense.paymentMethod.currency.id !== income.paymentMethod.currency.id\">\n      по&nbsp;курсу <input class=\"form-control form-control--sm\" type=\"number\" [(ngModel)]=\"sourceIncomeCurrencyRate\">\n      <span class=\"text-nowrap\">к <input class=\"form-control form-control--sm\" type=\"number\" [(ngModel)]=\"targetIncomeCurrencyRate\"></span>\n    </span>\n  </div>\n\n  <div *ngIf=\"getTargetAmount() !== null\" class=\"form__hint\">\n    ({{income.paymentMethod.currency.code}} {{getTargetAmount() | number:'1.2-2'}} будет начислено на счёт «{{income.paymentMethod.name}}»)\n  </div>\n\n  <div>\n    Дата: <datetime name=\"createdAt\" [(ngModel)]=\"expense.createdAt\"></datetime>,\n    комментарий: <input class=\"form-control\"\n                        name=\"comment\"\n                        [(ngModel)]=\"expense.comment\">\n    <div class=\"button-hint button-hint--lg\">\n      <div class=\"button-hint__inner\">\n        <button class=\"btn-primary btn btn-inline\"\n                [ladda]=\"loading\"\n                [disabled]=\"!canSave()\"\n                (click)=\"save()\">Записать транзакцию</button>\n        <div class=\"button-hint__text\" [hidden]=\"canSave()\">\n          Укажите {{ getRequirements() }}\n        </div>\n      </div>\n    </div>\n  </div>\n</div>"

