module.exports = "<div class=\"modal-header\">\n  <h3>Посчитаем, состоятельные кроты?</h3>\n</div>\n<div class=\"modal-body\">\n  <p>Меня зовут Молли, и&nbsp;я&nbsp;расскажу вам, как тут всё устроено.</p>\n  <p>Транжира&nbsp;&mdash; это инструмент управления бюджетом. В&nbsp;нём вы&nbsp;задаёте свои счета, источники дохода, категории трат, а&nbsp;затем записываете траты, доходы или переводы между счетами.</p>\n  <p>Транжира показывает разнообразную статистику и&nbsp;позволяет оптимизировать расходы.</p>\n  <p>Если у&nbsp;вас установлено приложение на&nbsp;смартфоне, на&nbsp;который приходят смс-оповещения из&nbsp;банка о&nbsp;движении средств, Транжира будет записывать эти транзакции самостоятельно.</p>\n  <p>Сейчас я&nbsp;покажу вам, что нужно настроить, чтобы начать работу.</p>\n</div>\n<div class=\"modal-footer\">\n  <div class=\"m-b-n-sm\">\n    <span><button class=\"btn m-b-sm btn-primary\" (click)=\"nextStep()\" [ladda]=\"loading.nextStep\" [disabled]=\"loading.data\">Поехали!</button></span>\n    <span class=\"m-l-xs\"><button class=\"btn m-b-sm btn-default\" (click)=\"close()\" [ladda]=\"loading.closing\" [disabled]=\"loading.data\">Спасибо, я&nbsp;и&nbsp;так разберусь</button></span>\n  </div>\n</div>"

